import { Button, Stack, Typography } from '@mui/material';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import TextField from '@mui/material/TextField';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../Styles/editar-perfil.css';
import NavBar from '../components/NavBar';
const mainTheme = createTheme({ palette: { mode: 'dark', }, });

function EditarPerfil() {
  const navigate = useNavigate();

  const textStyle = {
    color: 'red',
    '&$disabled': {
      color: 'red',
    },
  };

  const handleDesativar = (e) => { }

  return (
    <ThemeProvider theme={mainTheme}>
      <CssBaseline />
      <NavBar isLoggedIn={true} />


      <Box sx={{ margin: 2, display: 'flex', flexDirection: 'column', alignItems: 'center', }}>
        <Box sx={{ margin: 2 }}>
          <Typography variant="h2" align='center'>Seu Perfil</Typography>
          <Divider orientation="horizontal" flexItem />
        </Box>

        <Box sx={{ margin: 2, display: 'flex', flexDirection: 'column', alignItems: 'center', width: '80%' }}>
          <Box sx={{ margin: 2, display: 'flex', flexDirection: 'column', alignItems: 'left' }}>
            <Typography variant="h4">Nome</Typography>
            <TextField margin="normal" id="nome" label="João das Neves" name="nome" disabled InputProps={{ readOnly: true, style: { color: 'red' }, }} InputLabelProps={{ style: { color: 'red' }, }} />
          </Box>

          <Box sx={{ margin: 2, display: 'flex', flexDirection: 'column', alignItems: 'left' }}>
            <Typography variant="h4">Email</Typography>
            <TextField margin="normal" fullwidth id="email" label="joaodasneves@example.com" name="email" disabled />
          </Box>
        </Box>

        <Box sx={{ margin: 2, display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
          <Stack spacing={2} direction='column' divider={<Divider orientation="horizontal" flexItem />}>
            <Button variant="contained" href='/AlterarPerfil'>Alterar Informações da Conta</Button>
            <Button variant="contained" color="secondary" href='/Home'>Cancelar</Button>
            <Button variant="contained" color="error" onClick={() => { handleDesativar(); }}>Desativar Conta</Button>
          </Stack>
        </Box>
      </Box>

    </ThemeProvider>
  );
}

export default EditarPerfil;
